import React from 'react';
import PropTypes from 'prop-types';

// Styling
import { Box, Flex, Text } from '../styles';

const Tile = ({ title }) => (
  <Box>
    <Text>{title}</Text>
  </Box>
);

Tile.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Tile;
